import React from 'react';
import styled from 'styled-components';
import { ThemeProvider } from "styled-components";

import Wrapper from "./components/Wrapper";
import Header from "./components/Header";
import HeaderText from "./components/HeaderText";
import HeaderLinks from "./components/HeaderLinks";
import Square from "./components/Square";
import SemiCircle from "./components/SemiCircle";
import SignUp from "./components/SignUp";

const theme = {
  font: "Avenir Next"
};

const Body = styled.body`
  width: 100vw;
`
const SignUpText = styled.p`
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 0.9em;
  letter-spacing: 0.01em;
`
const HeroText = styled.h1`
  display: grid;
  place-items: center;
  font-size: 2.2em;
  font-family: ${props => props.theme.font};
  font-weight: 700;
  color: white;
`

const HeroSection = styled.section`
  position: absolute;
  top: 22vh;
  width: 100vw;
`

const HeroText2 = styled.h3`
  display: grid;
  place-items: center;
  font-size: 1.4em;
  font-family: ${props => props.theme.font};
  font-weight: 400;
  line-height: 4em;
  color: white;
`


export default () => (
  <ThemeProvider theme={theme}>
    <Wrapper>
      <Body>
        <SemiCircle>
        <Header>
          <HeaderText primary>the</HeaderText>
          <HeaderText>polling project</HeaderText>
          <div></div>
          <Square>
          <HeaderLinks>FAQ</HeaderLinks></Square>
          <Square>
          <HeaderLinks>Past Polls</HeaderLinks></Square>
          <Square>
          <HeaderLinks>Log In</HeaderLinks></Square>
          <Square butn>
          <HeaderLinks>Sign Up</HeaderLinks>
          </Square>
        </Header>
        <HeroSection><HeroText>A big data solution to the polling problem</HeroText>
        <HeroText2>Participate in polls and engage in authentic, open conversation without bots or bias.</HeroText2></HeroSection>
        </SemiCircle> 
        <SignUp><SignUpText>SIGN UP</SignUpText></SignUp>
      </Body>
    </Wrapper>
  </ThemeProvider>
)
